/*Table structure for table `u_c` */

DROP TABLE IF EXISTS `u_c`;

CREATE TABLE `u_c` (
  `Id_Us` int(11) DEFAULT NULL,
  `Id_Canal` int(11) DEFAULT NULL,
  `Id_UC` int(11) NOT NULL AUTO_INCREMENT,
  `Fecha_Inscripcion` datetime DEFAULT NULL,
  PRIMARY KEY (`Id_UC`),
